import React from "react";

export type tRouteItem = {
  path: string
  element: React.FC
}

export const routesConf: tRouteItem[] = [
  {
    path: '/',
    element: React.lazy(() => import('../../pages/hosts'))
  },
  {
    path: '/ssh',
    element: React.lazy(() => import('../../pages/ssh'))
  },
  {
    path: '/scp',
    element: React.lazy(() => import('../../pages/scp'))
  },
  {
    path: '/recent',
    element: React.lazy(() => import('../../pages/recent'))
  },
]
